import { Container, Row, Col } from "react-bootstrap";

const Form = (props) => {
  return (
    <div className="gray-box forms">
      <Container>
        <Row>
          <Col xs={12}>
            <form>
              <Row></Row>
            </form>
          </Col>
        </Row>
      </Container>
    </div>
  );
};

export default Form;
